import OutputScreenRow from './outputScreenRow.js';

const OutputScreen = (props) => {
  return (
    <div class = "row" className="screen">
      <div class = "col">
      <OutputScreenRow value = {props.question}/>
      <OutputScreenRow value = {props.answer}/>
    </div>
    </div>
  )
}

export default OutputScreen;
